class ApprovalUserQualificationMd {  int? id;  String? user;  String? qualification;  String? documentNo;  String? dataAcquired;  String? expiryDate;  String? comments;  ApprovalUserQualificationMd({    this.id,    this.user,    this.qualification,    this.documentNo,    this.dataAcquired,    this.expiryDate,    this.comments,  });  ApprovalUserQualificationMd.fromJson(Map<String, dynamic> json) {    id = json['id'];    user = json['user'];    qualification = json['qualification'];    documentNo = json['documentNo'];    dataAcquired = json['dataAcquired'];    expiryDate = json['expiryDate'];    comments = json['comments'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['id'] = id;    data['user'] = user;    data['qualification'] = qualification;    data['documentNo'] = documentNo;    data['dataAcquired'] = dataAcquired;    data['expiryDate'] = expiryDate;    data['comments'] = comments;    return data;  }  factory ApprovalUserQualificationMd.all() {    return ApprovalUserQualificationMd(      id: 0,      user: '',      qualification: '',      documentNo: '',      dataAcquired: '',      expiryDate: '',      comments: '',    );  }}